​안녕하세요! 오늘은 저희 집 애완동물아이클레보 로봇청소기를 소개할까 해요!​바야흐로 두 달 반 전인 저의 생일!생일 선물 무엇을 갖고 싶니?!라는 시어머니의 질문에거침없이 로봇청소기를 던진저란 여자그리고 그 소원을 들어주신우리 멋진 시어머니사랑합니다그렇게 저희 집에 아이클레보 로봇청소기가 오게 되었어요!!!#아이클레보 #로봇청소기 #애완로봇 ​우리 집에 온 로봇청소기에게'월이'라는 이름을 지어 줬어요!!아시는 분들은 아시겠지만네 픽사 애니메이션 월-E의그 월이입니다 ㅋㅋ 먼 미래의 지구에서  쓰레기가 너무 많아만들어진 로봇 월이처럼부지런히 청소하라고눈도 붙여주고 이름도 붙여주고 ㅋㅋㅋ월이가 집에 온날 햇님이랑애니메이션까지 시청했드랬죠?ㅋㅋ아휴 너무 깜찍하지 않나요?아이클레보 로봇청소기의 디스플레이 부분이앞머리 같아서 눈이 너무 잘 어울리지 않나요?눈 스티커를 무려 3개를 사서 제일 어울리는 거로 선택했답니다 ㅋㅋㅋ원래 눈 스티커는 들어있지 않아요 ㅋㅋ​이제 본격적으로 우리 월이 아니아이클레보 로봇청소기를 소개할게요 ㅋㅋ​본체와 충전단자, 먼지통, 물통+먼지통, 물 걸래, 여분 앞발.. 이 아니고 브러슄ㅋㅋ리모컨과 긴 자석이 있어요!!긴 자석은 월이가 들어가면 안 되는곳에 두시면 됩니다!아이들 기준으로 하면 안전가드라고나 할까요!​사실 저희는 두 달 동안 사용하면서 아직 물 걸래 용은 써보질 못했어요그래서 지금도 깨끗!써야지 써야지 하면서도 아직 써보질 못했네요물걸레가 두 개나 있는데 말이죠 ㅜ왼쪽은 먼지들을 모아주는 먼지통이고오른쪽은 물통이에요!!!저도 빨리 물 걸래 용을 써봐야겠어요​소개는 이 정도로 간단히 하고자 월이가 청소하는 모습 한번 보실까요?층간 소음 방지 매트도 척척! 올라가는 게너무 기특하지요ㅋㅋ리모컨으로 자유롭게 이동할 수도 있지만 사실 잘 안 쓰게 돼요! 그 이유는 조금 후에 다시 언급할게요!집도 잘 찾아가는 월이!가자마자 '충전을 시작합니다' 하며 전기밥을 냠냠정말 손이 안 가는 애완동물이지요?이렇게 열심히 청소한 월이의 수집품을 한번 볼까요?와우 먼지가 한가극!!!!! 이렇게 월이가 먼지를 가득 모아오면 정말 기특하더라고요!! 이 개월 반 동안 정말 무시무시하게먼지들을 모아 왔습니다!!ㅋㅋ아니 먼지가 왜 이렇게 많은 거죠!?​월이가 그동안 얼마나 열심히일했는가 주인 입장에서 체크할 방법이 있습니다!!​바로 아이클레보 로봇청소기는 전용 앱을 지원해요!앱을 설치한 첫 화면(왼쪽)과로봇청소기를 선택했을 때 나오는 화면(오른쪽)입니다!청소기 선택 화면에서는 최근에 청소 한 내용이에요!!맨 위쪽 아이클레보  로고 옆쪽으로 있는 메뉴가 로봇청소기 등록 화면이에요청소기 설정 화면을 들어가면 세부 설정 사항을 확인하실 수 있습니다!​로봇청소기가 그동안 얼마나 청소를 열심히 했는지는청소 이력을 보면 알 수 있지요!제가 재택 하기 전까지는 정말 열심히 청소하는 아이였는데 제가 집에 있으니 청소가 잘 안돼요제가 방해물을 하도 많이 어질러 놔서청소 이력에서 한 번 더 클릭하시면 세부 청소 맵이 나와요!대충 저희 집 면적이 나오지요!?!좀 과하게 청소한 날은 오른쪽처럼 엄청난무언가가 생겨버리네요 청소를 하다 문제가 있어 청소가 중간에 끊기게 되면에러 이력으로 문제 사항을 세밀하게 알려줘요!브러시 이상은 대부분 제가 핸드폰 충전선을침대 밑으로 늘여트려 놓는 바람에월이가 항상 주어 먹어서 탈이 나는..그래서 전 항상 아침에 출근하기 전에방해물들을 싹 정리하고  예약 기능을 사용하여아무도 집에 없고 월이가 혼자 천천히 청소하기 좋은오후 4시에 예약을 걸어 두었죠 ㅎㅎ​예약 시 시간, 요일뿐 아니라 청소모드, 흡입력물공 급양까지 상세하게 설정이 가능해요그리고 리모컨을 안 쓰게 되는 이유!!바로 앱에도 리모컨 기능이 이기 때문이지요!굳이 리모컨을 찾아오지 않아도앱으로 바로 작동 시킬 수 있다는 것!너무 좋아요​우리 집 아이클레보 로봇청소기 월이 어떠셨나요?다음 기회에 저희 집 다른 친구들도 한 명씩 소개해드릴게요​ 
