예전부터 꼭 해먹어 보고 싶던 에어프라이어 막창!드디어 그 꿈을 이뤘어요!! 완전히 생 막창으로 돌리면 혹시나 안 익을까 하는 마음에포차촌의 훈제막창으로 도전!신선함이 유지되게 아이스박스에 포장되어 왔네요찍어 먹기용 막창 소스와 매운맛을 원할 경우함께 볶을 수 있는 매운 양념도 함께 왔어요훈제로 초벌을 하고 진공포장되어 있어서 생각보다 유통기간이 널널하더라고요쟁여두고 혼술안주로 꺼내 먹기 좋을 것 같아요쉽게 에어프라이어막창에 도전하지 못했던 이유가넘나 작은 울 집 에어프라이어 흑흑그래도 이번엔 꼭 먹고 싶어서 도전했어요처음엔 기름종이를 깔고 돌렸는데 쫙쫙 빠지는 기름을 보니 그럴 필요가 없어서중간부터는 그냥 바로 돌렸어요사실 전에 막창을 구워 먹을 때 막창 본연의 냄새가엄청 심하게 났었는데 훈제 막창이라 그런지그런 막창 특유의 냄새가 하나도 안 나더라고요! 에어프라이어로 돌리니 번거롭지도 않고 훈제 막창이라 냄새도 향긋하니굳이 밖으로 나가서 먹을 필요가 없네요!!소스도 넉넉하니 집에 있는 와사비도 추가해 줬어요불막창용 소스도 그냥 두기 아까워서 찍먹용으로 ㅎㅎ그런데 에어프라이어막창 비주얼이 원래 이렇게 끝내줬나요? 와 진짜 왜 사람들이 그렇게 에어프라이어막창을꼭꼭 먹어보라고 했는지 보기만 해도 술이 꼴각꼴각 넘어가네요막창 하나 들고 소스를 찍어서 먹으니겉은 바삭바삭하게 익고 속을 쫄깃쫄깃하니곱창집에서 구워 먹는 막창 맛은 이제 저 멀리 사라지고앞으로는 무조건 이거다!라는 생각 밖에 안 드네요이렇게 맛있는 걸 나는 왜 이제야 해먹은 거냐 뼈저린 후회를 하면서 혼술 냠냠했네요!진짜 너무너무 맛있었어요! 좀 더 다양하게 먹기 위해 고기 소스에 와사비 풀어먹기도 하고양념소스 찍어 쌈 싸 먹기도 하고어떻게 먹어도 너무너무 맛있는 에어프라이어막창!진짜 처음 한 번이 어렵지 앞으로는 자주자주 해먹을 것 같아요!​#혼술안주 #에어프라이어막창 #훈제막창 #한입막창 #술안주 #돼지막창​​노비 //,

